import React from 'react';

function Food(props)  {
  return <h1>I like {props}</h1>
}

function App() {
  return (
  <div>
    <h1>
    Hello!! React!!
    <Food fav="kimchi"/> 
    </h1>
  </div>
  )
}

export default App;
